const defaultTaskList = [{ text: 'Complete online Java', completed: true },
{ text: 'Jog around the park 3x', completed: false },
{ text: '10 minutes meditation', completed: false },
{ text: 'Read for one hour', completed: false },
{ text: 'Pick up groceries', completed: false },
{ text: 'Read for one hour', completed: false },
{ text: 'Complete Todo App on Frontend Mentor', completed: false },]

function App() {
  return (
    <reactFragment>
      <Header completed={10} total={15} />
      <TaskCreation>{defaultTodos.map(todo => (
        <TodoItem
          key={todo.text}
          text={todo.text}
          completed={todo.completed} />))}
        </TaskCreation>

    </reactFragment>
  );
}

export default App;
